import AppLayout from "../compoenets/AppLayout";
import Head from 'next/head'
const Signup = ()=>{
    return (
        <>
            <Head>
                <title>회원가입|NodeBird</title>
            </Head>
            <AppLayout>
                    <div>회원가입</div>
            </AppLayout>
            
        </>    
    )
}

export default Signup;
